import styled from "styled-components";

const WrapBox = styled.div`
  background: linear-gradient(to bottom, #000000, #4f4f51);
  min-height: 100vh;
  max-width: auto;
  margin: 0 auto;
  padding-top:117.5px; //가려지지 않도록 앱바 높이만큼 설정해줌 
`;

export default WrapBox
